import React, { Component } from "react";
import api from "../util/api";

class FunkosToTradeContainer extends Component {
  state = {
    funkos: []
  };

  componentDidMount() {
    api.funkosAvailableToTrade(this.props.currentUser.id);
  }

  render() {
    return <div />;
  }
}

export default FunkosToTradeContainer;
